import React from 'react'
import './Logo.less'

export default function Logo () {
    return (
        <div className="logo-container">
            <img alt="logo" className="https://store-images.microsoft.com/image/apps.51984.13510798882931730.2349acc6-7ddf-492f-840e-979b0abe8e37.1ea91715-2bcc-46ec-a249-da2abc58c607?mode=scale&q=90&h=300&w=300" />
        </div>
    )
}
